import logo from './logo.svg';
import './App.css';
import {Map} from './MapboxMap';
import {Titlebar} from './Titlebar';
import {Infobar} from './Infobar';
import {Searchbar} from './Searchbar';
import React, { useState } from 'react';
import ReactDOM from "react-dom";
//import { Leaflet, Icon } from "leaflet";
//import 'leaflet/dist/leaflet.css';


const App = () => {
  const [markers, setMarkers] = useState(undefined);

  fetchMarkers = async() => {
    try {
      const response = await fetch("/allops");
      const data = await response.json();
      console.log("Fetch successful!");
      setMarkers(data);
    } catch (err) {
      console.log("There was a problem with backend connection");
      return;
    }
  }

  return ( 
    <div>
    <Titlebar />
    <table width="100%">
      <tr>
        <td className="left-container"></td>
        <td className="map-container">
        <Searchbar fetchMarkers={fetchMarkers}/>
        <Map markers={markers}/>
        </td>
        <td>
          <div className="info-container">
        <Infobar num={1}/>
        <Infobar num={2}/>
        <Infobar num={3}/>
        <Infobar num={4}/>
        <Infobar num={5}/>
        <Infobar num={6}/>
        </div>
        </td>
      </tr>     
      </table> 
    </div>
   );
}

export default App;

